import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/Login";

function Home() {
  return <h1>Welcome to GSharp Music Hub!</h1>;
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
